import React, { useState, useEffect, useCallback, useRef } from 'react';
import './App.css';

const PASSWORD = 'cosmocommand1';
const AUTH_KEY = 'cosmo_auth';

// Mock data for demo mode
const generateMockData = () => {
  const now = Date.now();
  return {
    nodes: [
      { id: 'main', name: 'Cosmo', type: 'main', status: 'running' },
      { id: 'agent-1', name: 'Research Agent', type: 'sub-agent', status: 'running', parentSession: 'main' },
      { id: 'agent-2', name: 'Code Agent', type: 'sub-agent', status: 'running', parentSession: 'main' },
      { id: 'tool-1', name: 'Web Search', type: 'tool', toolType: 'search', status: 'complete', parentSession: 'agent-1' },
      { id: 'tool-2', name: 'Browser', type: 'tool', toolType: 'browser', status: 'running', parentSession: 'agent-1' },
      { id: 'tool-3', name: 'Terminal', type: 'tool', toolType: 'terminal', status: 'running', parentSession: 'agent-2' },
    ],
    links: [
      { source: 'main', target: 'agent-1', active: true },
      { source: 'main', target: 'agent-2', active: true },
      { source: 'agent-1', target: 'tool-1', active: false },
      { source: 'agent-1', target: 'tool-2', active: true },
      { source: 'agent-2', target: 'tool-3', active: true },
    ],
    commands: [
      { id: 1, content: 'Research latest AI developments', sessionKey: 'agent-1', sessionName: 'Research Agent', status: 'running', timestamp: now - 30000 },
      { id: 2, content: 'Search for OpenAI announcements', sessionKey: 'agent-1', sessionName: 'Research Agent', status: 'complete', timestamp: now - 120000 },
      { id: 3, content: 'Review codebase optimizations', sessionKey: 'agent-2', sessionName: 'Code Agent', status: 'running', timestamp: now - 45000 },
    ]
  };
};

// Password Gate Component
const PasswordGate = ({ onAuth }) => {
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    if (password === PASSWORD) {
      localStorage.setItem(AUTH_KEY, 'true');
      onAuth(true);
    } else {
      setError('Incorrect password');
    }
  };

  return (
    <div className="password-gate">
      <div className="password-container">
        <div className="password-logo">⚡</div>
        <h1 className="password-title">COSMO COMMAND</h1>
        <p className="password-subtitle">Mobile Access Portal</p>

        <form onSubmit={handleSubmit} className="password-form">
          <input
            type="password"
            value={password}
            onChange={(e) => {
              setPassword(e.target.value);
              setError('');
            }}
            placeholder="Enter access code"
            className="password-input"
            autoFocus
          />
          {error && <div className="password-error">{error}</div>}
          <button type="submit" className="password-submit">
            ACCESS SYSTEM
          </button>
        </form>
      </div>
    </div>
  );
};

// Simple Graph Visualization
const SimpleGraph = ({ data }) => {
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;

    const ctx = canvas.getContext('2d');
    const dpr = window.devicePixelRatio || 1;
    const rect = canvas.getBoundingClientRect();

    canvas.width = rect.width * dpr;
    canvas.height = rect.height * dpr;
    ctx.scale(dpr, dpr);

    const width = rect.width;
    const height = rect.height;

    // Clear canvas
    ctx.fillStyle = '#0a0a0a';
    ctx.fillRect(0, 0, width, height);

    // Draw grid
    ctx.strokeStyle = 'rgba(0, 255, 255, 0.03)';
    ctx.lineWidth = 1;
    for (let x = 0; x < width; x += 40) {
      ctx.beginPath();
      ctx.moveTo(x, 0);
      ctx.lineTo(x, height);
      ctx.stroke();
    }
    for (let y = 0; y < height; y += 40) {
      ctx.beginPath();
      ctx.moveTo(0, y);
      ctx.lineTo(width, y);
      ctx.stroke();
    }

    if (!data.nodes || data.nodes.length === 0) return;

    // Position nodes in a circle
    const centerX = width / 2;
    const centerY = height / 2;
    const radius = Math.min(width, height) * 0.35;

    const nodePositions = {};
    data.nodes.forEach((node, i) => {
      if (node.type === 'main') {
        nodePositions[node.id] = { x: centerX, y: centerY };
      } else {
        const angle = (i / (data.nodes.length - 1)) * Math.PI * 2 - Math.PI / 2;
        nodePositions[node.id] = {
          x: centerX + Math.cos(angle) * radius,
          y: centerY + Math.sin(angle) * radius
        };
      }
    });

    // Draw links
    data.links.forEach(link => {
      const source = nodePositions[link.source];
      const target = nodePositions[link.target];
      if (source && target) {
        ctx.beginPath();
        ctx.moveTo(source.x, source.y);
        ctx.lineTo(target.x, target.y);
        ctx.strokeStyle = link.active ? 'rgba(0, 255, 255, 0.6)' : 'rgba(245, 158, 11, 0.3)';
        ctx.lineWidth = link.active ? 2 : 1;
        ctx.stroke();
      }
    });

    // Draw nodes
    data.nodes.forEach(node => {
      const pos = nodePositions[node.id];
      if (!pos) return;

      const isRunning = node.status === 'running';
      const size = node.type === 'main' ? 25 : 15;

      // Glow
      if (isRunning) {
        ctx.beginPath();
        ctx.arc(pos.x, pos.y, size + 8, 0, Math.PI * 2);
        ctx.fillStyle = node.type === 'main' ? 'rgba(0, 255, 255, 0.2)' : 'rgba(245, 158, 11, 0.2)';
        ctx.fill();
      }

      // Node circle
      ctx.beginPath();
      ctx.arc(pos.x, pos.y, size, 0, Math.PI * 2);
      ctx.fillStyle = '#161616';
      ctx.fill();
      ctx.strokeStyle = isRunning ? '#00ffff' : '#f59e0b';
      ctx.lineWidth = 2;
      ctx.stroke();

      // Label
      ctx.fillStyle = '#fff';
      ctx.font = '11px JetBrains Mono';
      ctx.textAlign = 'center';
      ctx.fillText(node.name, pos.x, pos.y + size + 18);
    });

  }, [data]);

  return <canvas ref={canvasRef} className="graph-canvas" />;
};

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [graphData, setGraphData] = useState(generateMockData());
  const [logs, setLogs] = useState([{ id: 1, time: new Date().toLocaleTimeString(), message: 'System initialized - Demo Mode', type: 'info' }]);
  const [activeAgents, setActiveAgents] = useState(3);
  const [activeTools, setActiveTools] = useState(2);
  const [showPanel, setShowPanel] = useState(false);

  // Check auth on mount
  useEffect(() => {
    const auth = localStorage.getItem(AUTH_KEY);
    if (auth === 'true') {
      setIsAuthenticated(true);
    }
  }, []);

  // Simulate live updates
  useEffect(() => {
    const interval = setInterval(() => {
      setGraphData(prev => {
        const newData = { ...prev };
        // Randomly toggle tool status
        newData.nodes = prev.nodes.map(node => {
          if (node.type === 'tool' && Math.random() > 0.7) {
            return { ...node, status: node.status === 'running' ? 'complete' : 'running' };
          }
          return node;
        });
        // Update links
        newData.links = prev.links.map(link => {
          const targetNode = newData.nodes.find(n => n.id === link.target);
          return { ...link, active: targetNode?.status === 'running' };
        });
        return newData;
      });

      const now = new Date();
      setLogs(prev => [{
        id: Date.now(),
        time: now.toLocaleTimeString(),
        message: `Poll: ${activeAgents} agents, ${activeTools} tools active`,
        type: 'info'
      }, ...prev].slice(0, 20));
    }, 3000);

    return () => clearInterval(interval);
  }, [activeAgents, activeTools]);

  const handleLogout = () => {
    localStorage.removeItem(AUTH_KEY);
    setIsAuthenticated(false);
  };

  if (!isAuthenticated) {
    return <PasswordGate onAuth={setIsAuthenticated} />;
  }

  return (
    <div className="app-container">
      {/* Header */}
      <header className="header">
        <div className="header-left">
          <span className="logo-icon">⚡</span>
          <h1 className="title">COSMO COMMAND</h1>
          <span className="status-badge online">DEMO</span>
        </div>
        <div className="header-right">
          <button className="icon-btn" onClick={() => setShowPanel(!showPanel)}>
            {showPanel ? '✕' : '☰'}
          </button>
        </div>
      </header>

      {/* Main Content */}
      <div className="main-content">
        {/* Graph */}
        <div className="graph-container">
          <SimpleGraph data={graphData} />

          {/* Stats */}
          <div className="stats-overlay">
            <div className="stat-item">
              <span className="stat-label">AGENTS</span>
              <span className="stat-value cyan">{activeAgents}</span>
            </div>
            <div className="stat-item">
              <span className="stat-label">TOOLS</span>
              <span className="stat-value amber">{activeTools}</span>
            </div>
          </div>
        </div>

        {/* Side Panel */}
        {showPanel && (
          <div className="side-panel">
            <div className="panel-section">
              <div className="panel-header">
                <span>COMMANDS</span>
              </div>
              <div className="commands-container">
                {graphData.commands.map(cmd => (
                  <div key={cmd.id} className="command-item">
                    <div className="command-text">{cmd.content}</div>
                    <div className="command-meta">
                      <span className="command-agent">{cmd.sessionName}</span>
                      <span className={`command-status ${cmd.status}`}>
                        {cmd.status === 'running' ? '●' : '✓'}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            <div className="panel-section logs-section">
              <div className="panel-header">
                <span>LOGS</span>
              </div>
              <div className="logs-container">
                {logs.map(log => (
                  <div key={log.id} className="log-entry">
                    <span className="log-time">{log.time}</span>
                    <span className={`log-type ${log.type}`}>●</span>
                    <span className="log-message">{log.message}</span>
                  </div>
                ))}
              </div>
            </div>

            <div className="panel-footer">
              <button className="logout-btn" onClick={handleLogout}>
                LOGOUT
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
